void dbgSchedInit(SippPipeline *pl)
{
//Filters buffer sizes [lines]
  pl->filters[ 0]->nLines = 1; 
  pl->filters[ 1]->nLines = 0; 

//Kernel Starts (only for filters with parents !)
  pl->filters[ 1]->parentsKS[ 0] = 0;

//The schedule mask for all iterations
  pl->nIter          = 513;
  pl->schedInfo      = sippDumpedSched;
}
